import{_ as t,c as e,o as s,a as r}from"./app.b80f3151.js";var o="/cubepress/toolbar.png",a="/cubepress/menubar.png",i="/cubepress/searchiccid.png",n="/cubepress/sortusage.png",d="/cubepress/statusprogress.png",l="/cubepress/bundleinfo.png",c="/cubepress/more.png";const k=JSON.parse('{"title":"\u{1F4F6} SIMs","description":"","frontmatter":{},"headers":[{"level":2,"title":"SIM List","slug":"sim-list"},{"level":3,"title":"Table Toolbar \u2699\uFE0F","slug":"table-toolbar-\u2699\uFE0F"},{"level":3,"title":"Table Menu Bar \u26A1\uFE0F","slug":"table-menu-bar-\u26A1\uFE0F"},{"level":3,"title":"Columns","slug":"columns"},{"level":3,"title":"SIM Detail","slug":"sim-detail"},{"level":3,"title":"Bundle History","slug":"bundle-history"},{"level":3,"title":"CDR","slug":"cdr"}],"relativePath":"guide/checksim.md","lastUpdated":1665379853000}'),h={name:"guide/checksim.md"},g=r('<h1 id="\u{1F4F6}-sims" tabindex="-1">\u{1F4F6} SIMs <a class="header-anchor" href="#\u{1F4F6}-sims" aria-hidden="true">#</a></h1><h2 id="sim-list" tabindex="-1">SIM List <a class="header-anchor" href="#sim-list" aria-hidden="true">#</a></h2><p>You may check the basic information of the SIM in the list, and we offer enriched features above and beyond.</p><hr><h3 id="table-toolbar-\u2699\uFE0F" tabindex="-1">Table Toolbar \u2699\uFE0F <a class="header-anchor" href="#table-toolbar-\u2699\uFE0F" aria-hidden="true">#</a></h3><blockquote><p>Configuration of the table</p></blockquote><p><img src="'+o+'" alt="toolbar"></p><ul><li><strong>Height Setting</strong> for table rows: <em>default, medium or compact.</em></li><li><strong>Column Setting</strong> to check only the columns you&#39;d like to see</li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Tick 3-4 columns of interets, view data <strong>without left and right scrolling</strong></p></div><ul><li><strong>Refresh Table Data</strong></li><li><strong>Global Search Bar</strong> to search by ICCID/IMEI/MSISDN</li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Quick find the SIM by entering <strong>partial ending digits</strong> in global search bar. Searching will happen in order of <code>ICCID</code>, <code>IMEI</code> then <code>MSISDN</code> and return all the matched results.</p><p>E.g.: <code>023801</code>=&gt; ICCID <code>89013113804763023801</code>, IMEI <code>230A8X023801</code></p></div><hr><h3 id="table-menu-bar-\u26A1\uFE0F" tabindex="-1">Table Menu Bar \u26A1\uFE0F <a class="header-anchor" href="#table-menu-bar-\u26A1\uFE0F" aria-hidden="true">#</a></h3><blockquote><p>Actions present in menu bar allow users to perform quick bulk actions on selected SIMs (1 or more).</p></blockquote><p><img src="'+a+'" alt="menubar"></p><ul><li>Export the selected SIMs or all SIMs into excel file</li><li>Edit tags</li><li>Edit notes</li><li>Send SMS to the selected SIM</li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Edit tags or notes in bulk will <strong>override</strong> the existing tags/notes.</p></div><hr><h3 id="columns" tabindex="-1">Columns <a class="header-anchor" href="#columns" aria-hidden="true">#</a></h3><p>Data columns of the SIM List are:</p><table><thead><tr><th>Columns</th><th>Description</th><th>Remarks</th></tr></thead><tbody><tr><td><strong>ICCID</strong></td><td>The unique <strong>I</strong>ntegrated <strong>C</strong>ircuit <strong>C</strong>ard <strong>Id</strong>entification Number of the SIM by global standards.</td><td></td></tr><tr><td><strong>Organisation</strong></td><td>Organisation that owns the SIM asset.</td><td></td></tr><tr><td><strong>IMEI</strong></td><td><strong>I</strong>nternational <strong>M</strong>obile <strong>E</strong>quipment <strong>I</strong>dentity that identifies the device which uses the SIM.</td><td>Dial <code>*#06#</code> on a screened device to find out the IMEI</td></tr><tr><td><strong>MSISDN</strong></td><td><strong>M</strong>obile <strong>S</strong>tation <strong>I</strong>ntegrated <strong>S</strong>ervices <strong>D</strong>igital <strong>N</strong>etwork is the phone number which identifies a device during calls or data sessions.</td><td></td></tr><tr><td><strong>Status</strong></td><td>It indicates the current life cycle stage of the SIM.</td><td>refer to <a href="/cubepress/guide/simstatus.html">SIM status</a> for more details.</td></tr><tr><td><strong>Tags</strong></td><td>Add, edit or remove tags for individual SIM or SIMs in bulk.Tags can be used to filter and group SIMs.</td><td>Max. 5 tags per SIM and max. 10 characters per tag</td></tr><tr><td><strong>Notes</strong></td><td>Add, edit or remove notes for SIMs.</td><td>Max. 40 characters per note</td></tr><tr><td><strong>Expire At</strong></td><td>When service contract expires for the SIM.</td><td><a href="./simstatus.html">Grace period</a> applies upon expiration.</td></tr><tr><td><strong>Network</strong></td><td>Local network of the last data session</td><td>Empty if no session in the last 3 months</td></tr><tr><td><strong>Last Session Time</strong></td><td>Last data session start time</td><td>Empty if no session in the last 3 months</td></tr><tr><td><strong>Usage</strong></td><td>Data usage of the current service cycle</td><td>day, month or year</td></tr><tr><td><strong>Limit</strong></td><td>Data limit of the current service cycle</td><td>day, month or year</td></tr></tbody></table><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Search for IMEI, ICCID, MSISDN etc in the column. You can also quick search a SIM by simply <strong>entering its ending digits</strong>.</p><p>It also applies to <code>IMEI</code>, <code>MSISDN</code> searching.</p><p><img src="'+i+'" alt="search imei"></p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Quickly find out the top-10 data usage SIMs by sorting <code>Usage</code> column <img src="'+n+'" alt="sort usage"></p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Hit <code>Refresh</code> icon button \u{1F504} in the tool bar to clear all the filtering, sorting and searching citeria.</p></div><hr><h3 id="sim-detail" tabindex="-1">SIM Detail <a class="header-anchor" href="#sim-detail" aria-hidden="true">#</a></h3><p>You may press \u25B6 to expand more SIM detail. Some important information include:</p><hr><h4 id="status-progress" tabindex="-1">Status progress <a class="header-anchor" href="#status-progress" aria-hidden="true">#</a></h4><p><img src="'+d+'" alt="status progress"></p><p>It indicates the <strong>start and estimated end date</strong> of the <strong>current</strong> SIM status.</p><hr><h4 id="bundle-info" tabindex="-1">Bundle Info <a class="header-anchor" href="#bundle-info" aria-hidden="true">#</a></h4><p><img src="'+l+'" alt="bundle info"></p><p>Validity of the bundle is usually comensurate with the &quot;active&quot; status progress. Expiration of the service bundle could very well mean the expiration of the SIM should there be <strong>NO</strong> other service bundle or top-up package in place.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Click <a href="/cubepress/sim/overage.html">here</a> for <strong>overage policy deep-dive</strong></p></div><hr><h4 id="usage-history" tabindex="-1">Usage History <a class="header-anchor" href="#usage-history" aria-hidden="true">#</a></h4><p>Data usage history can be queried via date picker and can be downloaded.</p><div class="warning custom-block"><p class="custom-block-title">Limitation</p><p>Usage history can&#39;t be dated back to more than 12 months ago.</p></div><hr><h3 id="bundle-history" tabindex="-1">Bundle History <a class="header-anchor" href="#bundle-history" aria-hidden="true">#</a></h3><p>You may refer to bundle history in case SIM has subscribed to more than 1 service bundle. It can be exported.</p><hr><h3 id="cdr" tabindex="-1">CDR <a class="header-anchor" href="#cdr" aria-hidden="true">#</a></h3><p><img src="'+c+'" alt="cdr"></p><p>Click <strong>CDR</strong> to check all the <strong>data/voice/sms sessions</strong> of the SIM in a given time span.</p>',47),u=[g];function p(m,b,I,f,S,v){return s(),e("div",null,u)}var _=t(h,[["render",p]]);export{k as __pageData,_ as default};
